import * as React from "react";
import { useState, useEffect } from "react";
import Contribution from "../../components/Contribution/Contribution";
import Header from "../../components/Header/Header";
import TimeInput from "../../components/TimeInput/TimeInput";
import { Link } from "react-router-dom";
import { AnalysisBox, WeekBox } from "./style";
import CalendarTodayIcon from "@mui/icons-material/CalendarToday";
import DateRangeIcon from "@mui/icons-material/DateRange";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import Motivation from "../../components/Motivation/Motivation";
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import WeekStatus from "../../components/WeekStatus/WeekStatus";
import { getData } from "../../utils/getData";

function Dashboard() {
  useEffect(() => {
    getData(setData);
  }, []);

  const [data, setData] = useState([]);

  return (
    <>
      <Header />
      <Container maxWidth="lg" sx={{ marginTop: "3rem" }}>
        <Grid container spacing={4}>
          <Grid item xs={6}>
            <TimeInput dataNum={data.length} />
            <WeekStatus />
          </Grid>
          {/* <Contribution /> */}
          <Grid item xs={6}>
            <Motivation />
            <AnalysisBox>
              <h2>분석</h2>
              <div className="links">
                <Link
                  to="/analysis-week"
                  state={{ type: ["주간", "주", "Week"] }}
                >
                  <WeekBox>
                    <DateRangeIcon sx={{ fontSize: 50 }}></DateRangeIcon>
                    <h3>주간분석</h3>
                  </WeekBox>
                </Link>
                <Link
                  to="/analysis-month"
                  state={{ type: ["월간", "달", "Month"] }}
                >
                  <WeekBox>
                    <CalendarMonthIcon
                      sx={{ fontSize: 50 }}
                    ></CalendarMonthIcon>
                    <h3>월간분석</h3>
                  </WeekBox>
                </Link>
                <Link
                  to="/analysis-year"
                  state={{ type: ["연간", "년", "Year"] }}
                >
                  <WeekBox>
                    <CalendarTodayIcon
                      sx={{ fontSize: 50 }}
                    ></CalendarTodayIcon>
                    <h3>연간분석</h3>
                  </WeekBox>
                </Link>
              </div>
            </AnalysisBox>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}

export default Dashboard;
